©Ìï† Ïàò ÏûàÍ≤å Îê† Í≤ÉÏûÖÎãàÎã§. \r\n\r\n2. Ïó¨Îü¨ ÎÇòÎùºÏóêÏÑú ÎπÑÌä∏ÏΩîÏù∏ÏùÑ Ï†ïÏãù Í≤∞Ï†ú ÏàòÎã®ÏúºÎ°ú Ïù∏Ï†ïÌïòÎ©¥ÏÑú, Ïã§Î¨ºÌôîÌèêÏôÄ Í∞ÄÏÉÅÌôîÌèêÎ•º Í±∞ÎûòÌï† Îïå ÎçîÎäî Î∂ÄÍ∞ÄÍ∞ÄÏπòÏÑ∏Í∞Ä Î∂ÄÍ≥ºÎêòÏßÄ ÏïäÍ≤å ÎêúÎã§Í≥† Ìï©ÎãàÎã§. Ïã§Ï†úÎ°ú ÏùºÎ≥∏Í≥º Ìò∏Ï£ºÏóêÏÑúÎäî Ïù¥ÎØ∏ ÎπÑÌä∏ÏΩîÏù∏ÏùÑ Ìï©Î≤ïÏ†Å Í≤∞Ï†ú ÏàòÎã®ÏúºÎ°ú Ïù∏Ï†ïÌïòÎ©¥ÏÑú Ï†úÎèÑÍ∂å ÏïàÏúºÎ°ú Îì§Ïó¨Ïò§Í≥† ÏûàÍ≥†, ÎØ∏Íµ≠ÏóêÏÑúÎäî ÎπÑÌä∏ÏΩîÏù∏ ETF ÏäπÏù∏ ÎÖ∏Î†•ÎèÑ ÏßÑÌñâÎêòÍ≥† ÏûàÏäµÎãàÎã§. Í∞ÅÍµ≠Ïóê ÎπÑÌä∏ÏΩîÏù∏ÏùÑ Í∏∞Î∞òÏúºÎ°ú Ìïú ATM Í∏∞Í≥ÑÎèÑ ÏÑ§ÏπòÎêòÏóàÎã§Í≥† Ìï©ÎãàÎã§. ',
